"use strict";

function f_gold(k, prices) {
    const n = prices.length;
    if (n < 2) {
        return 0;
    }
    const dp = Array.from({ length: n }, () => Array.from({ length: k + 1 }, () => [0, 0]));
    for (let i = 1; i <= k; i++) {
        dp[0][i][1] = -prices[0];
    }
    for (let i = 1; i < n; i++) {
        for (let j = 1; j <= k; j++) {
            dp[i][j][0] = Math.max(dp[i - 1][j][1] + prices[i], dp[i - 1][j][0]);
            dp[i][j][1] = Math.max(dp[i - 1][j - 1][0] - prices[i], dp[i - 1][j][1]);
        }
    }
    return dp[n - 1][k][0];
}
